import React, { useState, useEffect } from "react";

const CanOpener = () => {
    const Participants = [
        { id: 0, name: "Red" },
        { id: 1, name: "Blue" },
        { id: 2, name: "Rue" },
    ];

    const userList = Participants.map((participant) => (
        <li key={participant}>{participant}</li>
    ));

    return <ul>{userList}</ul>;
};
export default CanOpener;
